import React from 'react'
import ChampionCard from '../components/ChampionCard.js' // just to test
import { Grid } from 'semantic-ui-react'

export default class ChampionsContainer extends React.Component {
// const ChampionsContainer = (props) => {
  render() {
    return(
      <Grid columns={4}  divided='vertically'>
        <Grid.Row>
        {this.props.champions.length > 0 ?
          this.props.champions.slice(0,4).map(champion => <ChampionCard champion={champion} />) : console.log('No Champions!')}
          </Grid.Row>

          <Grid.Row>
        {this.props.champions.length > 0 ?
          this.props.champions.slice(5,6).map(champion => <ChampionCard champion={champion} />) : console.log('No Champions!')}
          </Grid.Row>
      </Grid>
    )
  }

}

// export default ChampionsContainer
